# Dumping structure for procedure saleslead.getActivityTasks
DROP PROCEDURE IF EXISTS `getActivityTasks`;
DELIMITER //
CREATE DEFINER=`saleslead_admin`@`localhost` PROCEDURE `getActivityTasks`(IN `leadUserId` char(50), IN `actUserId` char(50), IN `orgId` int , IN `statusname` char(50), IN `types` char(50), IN `dates` date, IN `actClosed` char(50))
BEGIN

IF types="Open" then
select act.Name,types.Name 'TypeName',CONCAT(cont.FirstName,' ',cont.LastName),act.DueDate,act.Status,opp.OpportunityName,leads.Name 'leadName',act.Id from activity as act 
join lead as leads join opportunity as opp join contactinfo as cont join activitytype as types
 on  opp.LeadId=leads.Id and opp.Id=act.Opportunity and cont.UserId=act.AssignedTo and act.Type=types.Id
 where leads.AssignedRep like leadUserId and (act.AssignedTo like actUserId or act.CreatedBy like actUserId) and leads.AccountId like orgId and leads.Status like statusname and 
 opp.Status like statusname and act.Status like statusname and act.ActivityStatus!= actClosed order by act.Id desc;
  
ELSEIF types="Closed" THEN
select act.Name,types.Name 'TypeName',CONCAT(cont.FirstName,' ',cont.LastName),act.DueDate,act.Status,opp.OpportunityName,leads.Name 'leadName',act.Id  from activity as act 
join lead as leads join opportunity as opp join contactinfo as cont join activitytype as types
on opp.LeadId=leads.Id and opp.Id=act.Opportunity and cont.UserId=act.AssignedTo and act.Type=types.Id
where leads.AssignedRep like leadUserId and (act.AssignedTo like actUserId or act.CreatedBy like actUserId) and leads.AccountId like orgId and leads.Status like statusname and opp.Status like statusname and act.Status like statusname and act.ActivityStatus= types order by act.Id desc;

ELSEIF types="Today" THEN
select act.Name,types.Name 'TypeName',CONCAT(cont.FirstName,' ',cont.LastName),act.DueDate,act.Status,opp.OpportunityName,leads.Name 'leadName',act.Id from activity as act 
join lead as leads join opportunity as opp join contactinfo as cont join activitytype as types
on opp.LeadId=leads.Id and opp.Id=act.Opportunity and cont.UserId=act.AssignedTo and act.Type=types.Id
where leads.AssignedRep like leadUserId and (act.AssignedTo like actUserId or act.CreatedBy like actUserId) and leads.AccountId like orgId and leads.Status like statusname and opp.Status like statusname and act.Status like statusname and act.DueDate = DATE_FORMAT(dates,'%Y-%m-%d') and act.ActivityStatus!= actClosed order by act.Id desc;


ELSEIF types="Overdue" THEN
select act.Name,types.Name 'TypeName',CONCAT(cont.FirstName,' ',cont.LastName),act.DueDate,act.Status,opp.OpportunityName,leads.Name 'leadName',act.Id from activity as act 
join lead as leads join opportunity as opp join contactinfo as cont join activitytype as types
on opp.LeadId=leads.Id and opp.Id=act.Opportunity and cont.UserId=act.AssignedTo and act.Type=types.Id
where leads.AssignedRep like leadUserId and (act.AssignedTo like actUserId or act.CreatedBy like actUserId) and leads.AccountId like orgId and leads.Status like statusname and opp.Status like statusname and act.Status like statusname and act.DueDate < DATE_FORMAT(dates,'%Y-%m-%d') and act.ActivityStatus!= actClosed order by act.Id desc;


END IF;
END//
DELIMITER ;


