# Dumping structure for procedure saleslead.loginMember
DROP PROCEDURE IF EXISTS `loginMember`;
DELIMITER //
CREATE DEFINER=`saleslead_admin`@`localhost` PROCEDURE `loginMember`(IN `accountId` VARCHAR(100))
    COMMENT 'procedure to get logged user info'
BEGIN
SELECT uinfo.UserId,uinfo.Email,uinfo.RoleId,usercontact.FirstName,coalesce(usercontact.LastName,''),
role.RolePage,orginfo.Id
FROM userinfo AS uinfo 
JOIN contactinfo AS usercontact 
JOIN roleinfo AS role 
JOIN account as orginfo
ON uinfo.UserId=usercontact.UserId AND role.RoleId=uinfo.RoleId  
AND orginfo.Id=uinfo.AccountId
WHERE uinfo.Email=accountId;
END//
DELIMITER ;


